import React from 'react';
import './Main.css';
import Button from '../Buttons/Button';
export default function Main(){

    const l1=["C","+/-","%","/"];
    const l2=["9","8","7","*"];
    const l3=["6","5","4","-"];
    const l4=["3","2","1","+"];
    const l5=["0","."," ","="];

    return(
        <>
        <div className="main">
                <div className="top">

                </div>
                <div className="bottom">
                    <Button text1={l1[0]} text2={l1[1]} text3={l1[2]} text4={l1[3]}/>
                    <Button text1={l2[0]} text2={l2[1]} text3={l2[2]} text4={l2[3]}/>
                    <Button text1={l3[0]} text2={l3[1]} text3={l3[2]} text4={l3[3]}/>
                    <Button text1={l4[0]} text2={l4[1]} text3={l4[2]} text4={l4[3]}/>
                    <Button text1={l5[0]} text2={l5[1]} text3={l5[2]} text4={l5[3]}/>
                </div>
        </div>
        </>
    )
}
